import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { Navigation, Footer, Home} from "./components";
import { slide as Menu } from 'react-burger-menu'
import Proportion from "./Proportion.js"
import AnswerTime from "./AnswerTime.js"
import "./styles.css";

class OldTest extends React.Component {
  showSettings (event) {
    event.preventDefault();
  }

  render () {
    // NOTE: You also need to provide styles, see https://github.com/negomi/react-burger-menu#styling
    return (
      <Menu>
        <a id="home" className="menu-item" href="/">Home</a>
        <a id="about" className="menu-item" href="/Users/desmondmolloy/Desktop/CVs/CV_Desmond_Molloy_francais.html">Proportion</a>
        <a id="contact" className="menu-item" href="/contact">Time to answer</a>
        <a onClick={ this.showSettings } className="menu-item--small" href="">Settings</a>
      </Menu>
    );
  }
}

function Test() {
  return (
      <div>
      <Menu>
       <Route path="/about" exact component={() => <AnswerTime />} />
          <Route path="/contact" exact component={() => <Proportion />} />
        <a id="about" className="menu-item" href="javascript:Proportion()" onClick="javascript:Proportion()"> Answer time</a>
        <a id="about" className="menu-item" href="#x-proportion-time">Proportion </a>
      <a id="about" className="menu-item" href="#click-test" onClick="Proportion">Proportion </a>
      </Menu>
      <div id="#x-answer-time">
        <Proportion />
        </div>
      <div id="#x-proportion-time">
        <AnswerTime />
        </div>
      </div>
    );;
}

class Spacer {
  render(){ 
    return (
      <div>
        {Array(100).fill(<p>This is some text. This is some more text. This is even more text.</p>)}
      </div>
    );
  }
}


class App extends React.Component {
  render(){
    return (
      <div>
        <a href="#x-change-name">Go to change name</a>

        <AnswerTime />

        <a href="#x-alter-name">Go to proportion</a>

        <Proportion />

        <div id="x-change-name">
        <Proportion />
        </div>
        <div id="x-alter-name">

        </div>


      </div>
    );
  }
}


export default Test;
